import React from 'react';
import './App.css';


class App extends React.Component {
    constructor() {
        super();
        this.state = {
            txt: this.props.txt
        }
    }

    update(e) {
        this.setState(
            {
                txt: 'hello'
            }
        )
    }

    render() {
        return <h1>{this.props.txt}</h1>
    }
}

App.protoTypes = {
    txt: React.propTypes,
}
